/// <summary>
///    Creates a stack of kanbans that are pegged to the given record.
/// </summary>
/// <param name="_common">
///    A <c>Common</c> record.
/// </param>
/// <returns>
///    A <c>StackBase</c> object that holds kanbans pegged to the given record.
/// </returns>
/// <remarks>
///    The <c>Common</c> record is expected to be a <c>KanbanJob</c> or <c>KanbanJobPickingList</c> record.
/// </remarks>
private StackBase eventKanbansAsStack(Common _common)
{
    Kanban                  kanban;
    KanbanEventQuantityMap  kanbanEventQuantityMap;
    Map                     map;
    MapEnumerator           me;
    InventQty               peggedQty;
    StackBase               stack = new StackBase(Types::Container);

    kanbanEventQuantityMap = KanbanEventQuantityMap::newStandard(_common);
    map                    = kanbanEventQuantityMap.mapKanbanQuantities();

    if (   map
        && map.elements())
    {
        me = map.getEnumerator();
        while (me.moveNext())
        {
            kanban    = Kanban::find(me.currentKey());
            peggedQty = me.currentValue();

            if (   kanban
                && peggedQty)
            {
                stack.push([kanban.KanbanId,peggedQty]);
            }
        }
    }

    return stack;
}

/// <summary>
///    Initializes the current <c>KanbanPageTmp</c> record from an <c>InventDim</c> record.
/// </summary>
/// <param name="_inventDim">
///    An <c>InventDim</c> record.
/// </param>
private void initFromInventDim(InventDim _inventDim)
{
    //<GEERU>
    #ISOCountryRegionCodes
    //</GEERU>
    this.PickFromInventLocationId = _inventDim.InventLocationId;
    this.PickFromWMSLocationId    = _inventDim.wmsLocationId;
    this.PickInventBatchId        = _inventDim.InventBatchId;
    this.PickInventSerialId       = _inventDim.InventSerialId;
    this.PickWMSPalletId          = _inventDim.wmsPalletId;
    this.PickInventDimId          = _inventDim.InventDimId;

    InventProductDimension::initTableFromInventDim(this, _inventDim);

    //<GEERU>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]))
    {
        this.InventProfileId_RU       = _inventDim.inventProfileId_RU;
        this.InventOwnerId_RU         = _inventDim.InventOwnerId_RU;
        this.InventGtdId_RU           = _inventDim.InventGtdId_RU;
    }
    //</GEERU>
}

/// <summary>
///    Initializes the current <c>KanbanPageTmp</c> record from an <c>InventTable</c> record.
/// </summary>
/// <param name="_inventTable">
///    An <c>InventTable</c> record.
/// </param>
private void initFromInventTable(InventTable _inventTable)
{
    this.PickItemId       = _inventTable.ItemId;
    this.PickQuantityUnit = _inventTable.inventUnitId();
}

/// <summary>
/// Inserts records into the <c>KanbanPageTmp</c> table that is based on data in the <c>InventTrans</c>
/// table.
/// </summary>
/// <param name="_inventTransOriginId">
/// An <c>InventTransOriginId</c> value.
/// </param>
/// <param name="_eventKanbanStack">
/// A <c>StackBase</c> object.
/// </param>
private void insertInventTransOriginId(
    InventTransOriginId _inventTransOriginId,
    StackBase           _eventKanbanStack)
{
    InventTrans inventTrans;

    if (_inventTransOriginId)
    {
        while select InventDimId, sum(Qty) from inventTrans
            group by InventDimId
            where inventTrans.InventTransOrigin   == _inventTransOriginId
               && inventTrans.PackingSlipReturned == NoYes::No
        {
            this.initFromInventDim(InventDim::find(inventTrans.InventDimId));

            this.insertPickQuantity(-inventTrans.Qty,_eventKanbanStack);
        }
    }
}

    /// <summary>
    /// Inserts picking list records to this table for given kanban jobs.
    /// </summary>
    /// <param name="_listKanbanJobs">
    /// A container with IDâ€™s of kanban job records.
    /// </param>
    /// <param name="_workCell">
    /// A work cell name from which picking list was created; optional.
    /// </param>
    /// <param name="_includeTransfer">
    /// A Boolean value that defines if picking lines are included for transfer jobs; optional.
    /// </param>
    /// <remarks>
    /// Used by KanbanPageDP and KanbanPagePickListDP data provider classes.
    /// </remarks>
    /// <exception cref="M:Exception::Error">
    /// Encountered a kanban job of an unknown type.
    /// </exception>
    public void insertPickingList(
        List         _listKanbanJobs,
        WrkCtrIdBase _workCell        = ''
        ,
        boolean      _includeTransfer = false
        )
    {
        Query                   query;
        QueryRun                queryRun;
        QueryBuildDataSource    kanbanJob_ds;
        KanbanPageTmp           kanbanPageTmp;
        KanbanJob               kanbanJob;
        KanbanJobPickingList    kanbanJobPickingList;
        WrkCtrResourceGroup     wrkCtrResourceGroup;
        WrkCtrResourceGroup     wrkCtrResourceGroupFilter;
        InventTable             inventTable;
        InventDim               inventDim;
        InventTransOriginId     issueInventTransOriginId;
        StackBase               eventKanbanStack;
        WrkCtrResourceGroup     transferPickFromWorkCell;
        ListEnumerator          le = _listKanbanJobs.getEnumerator();

        query        = new Query();
        kanbanJob_ds = query.addDataSource(tableNum(KanbanJob));
        kanbanJob_ds.addSortField(fieldNum(KanbanJob,Kanban),SortOrder::Ascending);
        kanbanJob_ds.addSortField(fieldNum(KanbanJob,Sequence),SortOrder::Ascending);

        while (le.moveNext())
        {
            kanbanJob_ds.addRange(fieldNum(KanbanJob,RecId)).value(queryValue(le.current()));
        }

        if (_workCell)
        {
            wrkCtrResourceGroupFilter = WrkCtrResourceGroup::findWrkCtrId(_workCell);
        }

        queryRun = new QueryRun(query);
        while (queryRun.next())
        {
            kanbanJob = queryRun.get(tableNum(KanbanJob));

            // insert detail into separate instance of temporary table
            kanbanPageTmp.clear();
            kanbanPageTmp.CardId      = this.CardId;
            kanbanPageTmp.KanbanId    = this.KanbanId;
            kanbanPageTmp.HasPickList = this.HasPickList;
            kanbanPageTmp.PageNumber  = this.PageNumber;
            kanbanPageTmp.KanbanType  = this.KanbanType;
            kanbanPageTmp.UserName    = this.UserName;

            if (kanbanJob.Type == LeanKanbanJobType::Process)
            {
                if (   !wrkCtrResourceGroupFilter
                    || wrkCtrResourceGroupFilter.RecId == kanbanJob.WorkCell)
                {
                    wrkCtrResourceGroup                = kanbanJob.wrkCtrResourceGroup();
                    kanbanPageTmp.PickInventLocationId = wrkCtrResourceGroup.InputInventLocationId;
                    kanbanPageTmp.PickWMSLocationId    = wrkCtrResourceGroup.InputWMSLocationId;
                    kanbanPageTmp.PickWorkCell         = wrkCtrResourceGroup.WrkCtrId;

                    while select kanbanJobPickingList
                        where kanbanJobPickingList.Job == kanbanJob.RecId
                        join inventTable
                            where inventTable.ItemId == kanbanJobPickingList.ItemId
                    {
                        kanbanPageTmp.initFromInventTable(inventTable);

                        eventKanbanStack = kanbanPageTmp.eventKanbansAsStack(kanbanJobPickingList);

                        // if inventory controlled, use the specific dimensions and quantities
                        issueInventTransOriginId = kanbanJobPickingList.inventTransOriginId();
                        if (issueInventTransOriginId)
                        {
                            kanbanPageTmp.insertInventTransOriginId(issueInventTransOriginId,eventKanbanStack);
                        }
                        else
                        {
                            // not inventory controlled, use the picking list dimension and quantity
                            kanbanPageTmp.initFromInventDim(kanbanJobPickingList.inventDim());
                            kanbanPageTmp.insertPickQuantity(kanbanJobPickingList.Quantity,eventKanbanStack);
                        }
                    }
                }
            }
            else
            {
                if (kanbanJob.Type == LeanKanbanJobType::Transfer)
                {
                    if (_includeTransfer)
                    {
                        // use previous job work cell, if available; otherwise the picking does not take place at a work cell
                        transferPickFromWorkCell = kanbanJob.previousJob().wrkCtrResourceGroup();

                        if (   !wrkCtrResourceGroupFilter
                            || !transferPickFromWorkCell
                            || wrkCtrResourceGroupFilter.RecId == transferPickFromWorkCell.RecId)
                        {
                            kanbanPageTmp.initFromInventTable(kanbanJob.inventTable());

                            // initialize from receipt dimension
                            inventDim                          = kanbanJob.inventDim();
                            kanbanPageTmp.PickInventLocationId = inventDim.InventLocationId;
                            kanbanPageTmp.PickWMSLocationId    = inventDim.wmsLocationId;

                            kanbanPageTmp.PickWorkCell         =
                                                                 transferPickFromWorkCell.WrkCtrId ? transferPickFromWorkCell.WrkCtrId : "@SYS152490"
                                                                 ;

                            eventKanbanStack                   = kanbanPageTmp.eventKanbansAsStack(kanbanJob);

                            issueInventTransOriginId = kanbanJob.issueInventTransOriginId();

                            if (issueInventTransOriginId)
                            {
                                kanbanPageTmp.insertInventTransOriginId(issueInventTransOriginId,eventKanbanStack);
                            }
                            else
                            {
                                // not inventory controlled, use the kanban job issue dimensions and quantity
                                kanbanPageTmp.initFromInventDim(kanbanJob.issueInventDim());
                                kanbanPageTmp.insertPickQuantity(kanbanJob.QuantityOrdered,eventKanbanStack);
                            }
                        }
                    }
                }
                else
                {
                    // unknown job type
                    throw error(Error::wrongUseOfFunction(funcName()));
                }
            }
        }

        // aggregate and insert into this instance of temporary table
        while select CardId, KanbanId, HasPickList, PageNumber, KanbanType, UserName, PickWorkCell, PickInventLocationId,
                     PickWMSLocationId, PickFromInventLocationId, PickFromWMSLocationId, PickFromKanban, PickItemId, PickConfigId,
                     PickInventColorId,
                     PickInventStyleId,
					 PickInventVersionId,
                     // <GEERU>
                     InventProfileId_RU, InventOwnerId_RU, InventGTDId_RU,
                     // </GEERU>
                     PickInventSizeId, sum(PickQuantity), PickQuantityUnit, PickInventBatchId,
                     PickInventSerialId, PickWMSPalletId, PickInventDimId from kanbanPageTmp
            group by CardId, KanbanId, HasPickList, PageNumber, KanbanType, UserName, PickWorkCell, PickInventLocationId,
                     PickWMSLocationId, PickFromInventLocationId, PickFromWMSLocationId, PickFromKanban, PickItemId, PickConfigId,
                     PickInventColorId,
                     PickInventStyleId,
					 PickInventVersionId,
                     // <GEERU>
                     InventProfileId_RU, InventOwnerId_RU, InventGTDId_RU,
                     // </GEERU>
                     PickInventSizeId, PickQuantityUnit, PickInventBatchId, PickInventSerialId,
                     PickWMSPalletId, PickInventDimId
        {
            this.clear();

            this.CardId                   = kanbanPageTmp.CardId;
            this.KanbanId                 = kanbanPageTmp.KanbanId;
            this.HasPickList              = kanbanPageTmp.HasPickList;
            this.PageNumber               = kanbanPageTmp.PageNumber;
            this.KanbanType               = kanbanPageTmp.KanbanType;
            this.UserName                 = kanbanPageTmp.UserName;

            this.PickWorkCell             = kanbanPageTmp.PickWorkCell;
            this.PickInventLocationId     = kanbanPageTmp.PickInventLocationId;
            this.PickWMSLocationId        = kanbanPageTmp.PickWMSLocationId;
            this.PickFromInventLocationId = kanbanPageTmp.PickFromInventLocationId;
            this.PickFromWMSLocationId    = kanbanPageTmp.PickFromWMSLocationId;
            this.PickFromKanban           = kanbanPageTmp.PickFromKanban;
            this.PickItemId               = kanbanPageTmp.PickItemId;
            this.PickConfigId             = kanbanPageTmp.PickConfigId;
            this.PickInventColorId        = kanbanPageTmp.PickInventColorId;
            this.PickInventStyleId        = kanbanPageTmp.PickInventStyleId;
			this.PickInventVersionId      = kanbanPageTmp.PickInventVersionId;
            this.PickInventSizeId         = kanbanPageTmp.PickInventSizeId;
            this.PickQuantity             = kanbanPageTmp.PickQuantity;
            this.PickQuantityStr          = num2str(kanbanPageTmp.PickQuantity, 1, UnitOfMeasure::findBySymbol(kanbanPageTmp.PickQuantityUnit).DecimalPrecision, 1, 0);
            this.PickQuantityUnit         = kanbanPageTmp.PickQuantityUnit;
            this.PickInventBatchId        = kanbanPageTmp.PickInventBatchId;
            this.PickInventSerialId       = kanbanPageTmp.PickInventSerialId;
            this.PickWMSPalletId          = kanbanPageTmp.PickWMSPalletId;
            this.PickInventDimId          = kanbanPageTmp.PickInventDimId;
            // <GEERU>
            this.InventProfileId_RU       = kanbanPageTmp.inventProfileId_RU;
            this.InventOwnerId_RU         = kanbanPageTmp.InventOwnerId_RU;
            this.InventGtdId_RU           = kanbanPageTmp.InventGtdId_RU;
            // </GEERU>

            this.insert();
        }
    }

/// <summary>
///    Inserts records into the <c>KanbanPageTmp</c> table.
/// </summary>
/// <param name="_qty">
///    The picking quantity to insert.
/// </param>
/// <param name="_eventKanbanStack">
///    A <c>StackBase</c> instance that holds pegged kanbans.
/// </param>
/// <remarks>
///    Aside from the picking quantity and pegged kanban ID, records are expected to be fully initialized.
///    The quantity may be split into multiple records.
/// </remarks>
private void insertPickQuantity(
    InventQty     _qty,
    StackBase     _eventKanbanStack)
{
    KanbanId    kanbanId;
    InventQty   peggedQty;
    InventQty   peggedQtyNow;
    InventQty   pickQtyRemain = _qty;
    container   containerPop;

    if (pickQtyRemain > 0)
    {
        // issue, may be pegged to event kanban
        containerPop = _eventKanbanStack.pop();

        while (    pickQtyRemain > 0
                && containerPop)
        {
            [kanbanId,peggedQty] = containerPop;
            peggedQtyNow         = min(pickQtyRemain,peggedQty);
            pickQtyRemain       -= peggedQtyNow;

            this.PickFromKanban = kanbanId;
            this.PickQuantity   = peggedQtyNow;
            this.insert();

            if (peggedQty > peggedQtyNow)
            {
                _eventKanbanStack.push([kanbanId,peggedQty - peggedQtyNow]);
            }

            if (pickQtyRemain > 0)
            {
                containerPop = _eventKanbanStack.pop();
            }
        }
    }

    // the (remaining) unpegged quantity
    if (pickQtyRemain)
    {
        this.PickFromKanban = '';
        this.PickQuantity   = pickQtyRemain;
        this.insert();
    }
}
